import {AbsQscApi} from "../abstract/AbsQscApi";

class DubboQscApi extends AbsQscApi{

  search(pagingRequest) {
      return this.request({
          url: `/qscSearchPagerService/doSerach`,
          method: "post",
          data: [pagingRequest],
          baseURL: this.modulePath,
          headers: { "Content-Type": "application/json" }
      });
  }
  getQueryObjcet(id) {
      return this.request({
          url: `/qscSearchPagerService/getQueryObjcet`,
          method: "post",
          loading: true,
          data: [id],
          baseURL: this.modulePath,
          headers: { "Content-Type": "application/json" }
      })
  }
}

export {
  DubboQscApi
}
